  input: 'TEXT,F3XA,,"Amendment #2 addresses FEC letter dated February 21, 2007.  Each
    of the four bullet points are addressed, in their own order. All joint fundraising
    receipts are entered as memo entries.  There are timing differences in the filing
    of memo entries and the disbursement of funds from the joint fundraiser.  The
    references to SC Party Victory Fund relate to transfers in from DNC Services Corporation
    which are reported at various dates.  Memo entries are not always matched in the
    same period with a corresponding disbursement.  The Schedule H4 expenditures for
    party campaign planning and compliance and treasury services are not for party
    employees.  The providers of these services act as consultants.  Due to the nature
    of elections during the current cycle, the SCDP accurately reported all applicable
    salaries or wages on Schedule B supporting line 30(b) for the time period referred
    to in the letter from the FEC.  Likewise, all applicable taxes and fringe benefits
    are treated accurately for this reporting period.  Payments for fringe benefits
    and taxes for these employees are accurately disclosed on Schedue B supporting
    line 30(b).  Expenses paid for voter file maintenance are monthly recurring and
    fixed charges for the maintenance only of the voter file.  Every effort is made
    to accurately and timely report to the FEC."'
